$.aJ6=A.a(["  Divi\xe9rtete conociendo tu pa\xeds.","  Despierta inter\xe9s por las nuevas tecnolog\xedas.","  Mejora tu inteligencia espacial.","  Con ge0Juegos aprende geograf\xeda jugando.","  Muchas ni\xf1as, ni\xf1os, j\xf3venes y adultos ahora pueden aprender jugando."],t.s)
$.aJ9=A.a(["Creo que he encontrado el eslab\xf3n perdido entre el animal y el hombre civilizado.","Estoy seguro de que el universo est\xe1 lleno de vida inteligente. Simplemente ha sido demasiado inteligente para venir aqu\xed.","S\xf3lo hay dos cosas infinitas: el universo y la estupidez humana. Y no estoy tan seguro de la primera.","Me gustar\xeda tomarte en serio, pero hacerlo ser\xeda ofender tu inteligencia.","Nunca olvido una cara, pero en tu caso estar\xe9 encantado de hacer una excepci\xf3n","Todo el mundo tiene un prop\xf3sito en la vida, quiz\xe1s el tuyo sea ver la televisi\xf3n.","La inteligencia te persigue, pero t\xfa eres muy r\xe1pido.","Lo importante no es saber, sino tener el tel\xe9fono del que sabe, ll\xe1malo para que te ayude con este juego.","Por eso es que vida inteligente de otros planetas no quieren hacer contacto con nosotros.","Hijo m\xedo, la felicidad est\xe1 hecha de peque\xf1as cosas, por ejemplo ganar en este peque\xf1o y simple juego.","Estoy seguro de que el universo est\xe1 lleno de vida inteligente. Simplemente ha sido demasiado inteligente como para venir aqu\xed.","Vaya vaya, parece que esto no es lo tuyo."],t.s)
$.aJa=A.a(["Vas bien, pero no vendr\xeda mal repasar el atlas un poco m\xe1s.","Si el plan no funciona, cambia el plan. No cambies la meta.","Hay que perseverar para ver resultados.","Antes de rendirte... \xa1recuerda por qu\xe9 empezaste!","No rendirse y persistir es la clave del \xe9xito.","El fracaso es la oportunidad de empezar de nuevo con m\xe1s inteligencia.","Puede que el camino sea dif\xedcil, pero el crecimiento ser\xe1 exponencial.","El mayor placer de la vida es hacer lo que la gente dice que no puedes hacer. ","Esfu\xe9rzate al m\xe1ximo. Lo que siembres hoy dar\xe1 sus frutos ma\xf1ana.","No te sientas mal por no entender y preguntar. Al contrario, piensa en todo lo que estar\xe1s aportando a tus compa\xf1eros. ","Bueno parace que vas mejorando, toma un respiro e intenta nuevamente.","No bajes las manos, intentalo nuevamente, \xa1puedes lograrlo!","Si ca\xedste ayer, ponte en pie hoy."],t.s)
$.aJ7=A.a(["Piensa como un prot\xf3n: siempre en positivo. ","No tires la toalla... s\xe9cate el sudor con ella y vuelve a intentarlo nuevamente.","El cansancio es temporal, pero la satisfacci\xf3n es para siempre.","Las ra\xedces de la educaci\xf3n son amargas, pero el fruto es dulce.","Aprovecha e intenta aprender tanto como puedas... eso te dar\xe1 alas para volar.","Nuestra gloria m\xe1s grande no consiste en no haberse ca\xeddo nunca, sino en haberse levantado despu\xe9s de cada ca\xedda.","Para hacerlo, primero tienes que so\xf1arlo y despu\xe9s intentarlo. ","Siempre parece imposible hasta que se hace.","Una de las mejores formas de aprender es leyendo.","Ve a por ello ahora. El futuro no le es prometido a nadie."],t.s)
$.aJ8=A.a(["Lo que el mundo necesita es m\xe1s genios con humildad, somos tan escasos.","El camino al \xe9xito est\xe1 hecho de ganas... \xa1y a ti de eso te sobra! ","Tienes que permanecer en la escuela. Tienes que hacerlo. Tienes que ir a la universidad. Tienes que conseguir un t\xedtulo porque lo \xfanico que las personas no pueden quitarte es tu educaci\xf3n. ","T\xfa no estudias para saber m\xe1s, estudias para ignorar menos.","El \xe9xito depende del esfuerzo.","El \xe9xito es la suma de peque\xf1os esfuerzos, repetidos d\xeda tras d\xeda.","Cada logro comienza con la decisi\xf3n de intentarlo.","Nunca consideres el estudio como una obligaci\xf3n, sino como una oportunidad para penetrar en el bello y maravilloso mundo del saber.","Compite contigo mismo, no con los dem\xe1s.","Todo el mundo es un genio. Pero si juzgas a un pez por su habilidad para trepar \xe1rboles, vivir\xe1 toda su vida pensando que es un in\xfatil ","No esperes saberlo todo de golpe... paciencia, el camino es largo.","La esperanza reside en los sue\xf1os, en la imaginaci\xf3n y en el coraje de aquellos que se atreven a convertir sus sue\xf1os en realidad.","Nunca sabr\xe1s todo el potencial que se esconde en ti si no te esfuerzas por sacarlo.","Todos nuestros sue\xf1os se pueden volver realidad si tenemos el coraje de perseguirlos.","Un lector vive mil vidas antes de morir. Aquel que nunca lee vive solo una.","La Educaci\xf3n es el pasaporte hacia el futuro, el ma\xf1ana pertenece a aquellos que se preparan para \xe9l en el d\xeda de hoy.","Desarrolla una pasi\xf3n por aprender. Si lo haces, nunca dejar\xe1s de crecer.","Si te lo propones, puedes ser lo que m\xe1s quieras.","Un viaje de mil kil\xf3metros comienza con un simple paso.","Aprende como t\xfa quieras, pues en la educaci\xf3n no hay reglas.","Los r\xe9cords est\xe1n para ser superados, \xa1mejora tu tiempo!","Hoy har\xe9 los que otros no har\xe1n, para ma\xf1ana conseguir los que otros no pueden."],t.s)
